// Header.js
import React from 'react';

const Joincommunity = () => {
    return (
        <section class="">
            <div class="container_fluid slider_container">
                <div class="row">
                    <div class="col-md-6 col-12">
                        <h1 className="blueColor">Grade0</h1>
                        <p>Swap Your GR0 To Your Wallet</p>
                    </div>
                    <div className="col-md-4 offset-md-2 col-12">
                    <img src="/images/join_community.png" alt="Wallet" className="walletImage"/>

                    </div>
                </div>
            </div>
        </section>
    );
}

export default Joincommunity;
